function Splash_js() {
    /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'stemlogo': 'Splash_stemlogo',
        'mobilebutton_5': 'Splash_mobilebutton_5',
        'mobilelabel_4': 'Splash_mobilelabel_4'
    };
    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }
    /*
     * Nonvisual components
     */
    Apperyio.mappings = Apperyio.mappings || {};
    Apperyio.datasources = Apperyio.datasources || {};
    Apperyio.CurrentScreen = 'Splash';
    _.chain(Apperyio.mappings)
        .filter(function(m) {
            return m.homeScreen === Apperyio.CurrentScreen;
        })
        .each(Apperyio.UIHandler.hideTemplateComponents);
    /*
     * Events and handlers
     */
    // On Load
    var Splash_onLoad = function() {
        Splash_elementsExtraJS();
        $('div[dsid="mobilecontainerkaren"]').css('background-image',
            'url(' + Appery.getImagePath('Artboard_2.png') + ')');
        $('div[dsid="mobilecontainerkaren"]').css('background-size', '100% 100%');
        $('div[dsid="mobilecontainerkaren"]').css('background-position', 'center');
        $('div[dsid="mobilecontainerkaren"]').css('background-repeat', 'no-repeat');;
        Splash_deviceEvents();
        Splash_windowEvents();
        Splash_elementsEvents();
    };
    // screen window events
    function Splash_windowEvents() {
        $('#Splash').bind('pageshow orientationchange', function() {
            var _page = this;
            adjustContentHeightWithPadding(_page);
        });
    };
    // device events
    function Splash_deviceEvents() {
        document.addEventListener("deviceready", function() {
        });
    };
    // screen elements extra js
    function Splash_elementsExtraJS() {
        // screen (Splash) extra code
    };
    // screen elements handler
    function Splash_elementsEvents() {
        $(document).on("click", "a :input,a a,a fieldset label", function(event) {
            event.stopPropagation();
        });
        $(document).off("click", '#Splash_mobilecontainerkaren [name="mobilebutton_5"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('Login', {
                        transition: 'slide',
                        reverse: false
                    });
                }
            },
        }, '#Splash_mobilecontainerkaren [name="mobilebutton_5"]');
    };
    $(document).off("pagebeforeshow", "#Splash").on("pagebeforeshow", "#Splash", function(event, ui) {
        Apperyio.CurrentScreen = "Splash";
        _.chain(Apperyio.mappings)
            .filter(function(m) {
                return m.homeScreen === Apperyio.CurrentScreen;
            })
            .each(Apperyio.UIHandler.hideTemplateComponents);
    });
    Splash_onLoad();
};
